import React, { useState } from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components';
import CartRowBreve from "./cart_breve";
import {Title, Container, TitleImage} from "./Car_Long_Term";

export default function Car_Short_Term() {
    const [dates, setData] = useState([]);
    async function componentDidMount() {
        try {
            const res = await fetch('/api/car/breve/auto');
            const data = await res.json();
            setData(data);
        } catch (e) {
            console.log(e);
        }
    }
    componentDidMount();
    return(
        <>
        <Container>
            <TitleImage src="/static/images/top_image3.png"/>
            <Title>Noleggio a breve termine</Title>
        </Container>
        <CartRowBreve date={dates}/>
        </>
    );
}
